import Navigation from "./maincontent/Navigation";
import Hero from "./maincontent/Hero";
import Cards  from "./maincontent/Card";
import gambar1 from "../assets/card1.jpg";
import gambar2 from "../assets/card2.jpg";
// import gambar3 from "../assets/card3.jpg";

const Home = () =>{
    return(
        <div>
            <Navigation /> 
            <Hero/>
            <div className="container">
                <div className="row">
                    <div className="col-12 text-center my-5">
                        <h1>News</h1>
                    </div>
                </div>

                <div className="row justify-content-center">
                    <div className="col-md-4">
                        <Cards image={gambar1} />
                    </div>
                    <div className="col-md-3">
                        <Cards image={gambar2} />
                    </div>
                    <div className="col-md-3">
                        <Cards image={gambar2} />
                    </div>
                    <div className="col-md-3">
                        <Cards image={gambar1} />
                    </div>  
                </div>
            </div>
        </div>
    );
}

export default Home;
